import React from "react";

function SendFile() {
    return (
        <section>
            <h2>Send File</h2>
            <form>
                <div className="input-group">
                    <label htmlFor="file">Choose File:</label>
                    <input type="file" id="file" required />
                </div>
                <button type="submit">Send</button>
            </form>
        </section>
    );
}

export default SendFile;
